import 'dart:async';
import 'dart:convert';
import 'dart:typed_data';

import 'package:example/generated/translations.dart';
import 'package:flutter/material.dart';
import 'package:flutter/rendering.dart';
import 'package:flutter_easyrefresh/easy_refresh.dart';

/// 二楼示例页面
class SecondFloorPage extends StatefulWidget {
  @override
  _SecondFloorPageState createState() => _SecondFloorPageState();
}

class _SecondFloorPageState extends State<SecondFloorPage>
    with HeaderListener, TickerProviderStateMixin<SecondFloorPage> {
  List<String> addStr = ["1", "2", "3", "4", "5", "6", "7", "8", "9", "0"];
  List<String> str = ["1", "2", "3", "4", "5", "6", "7", "8", "9", "0"];
  GlobalKey<EasyRefreshState> _easyRefreshKey =
      new GlobalKey<EasyRefreshState>();
  GlobalKey<RefreshHeaderState> _headerKey =
      new GlobalKey<RefreshHeaderState>();
  GlobalKey<RefreshFooterState> _footerKey =
      new GlobalKey<RefreshFooterState>();
  // 触发刷新高度
  double _refreshHeight = 70.0;
  // 触发二楼高度
  double _secondFloorHeight = 100.0;
  bool _readyToSecondFloor = false;
  bool _expandSecondFloor = false;
  // 显示上拉图标
  bool _showPullIcon = false;
  // Header高度
  double _headerHeight = 0.0;
  // 指示器值
  double _indicatorValue = 0.0;
  bool _updateIndicatorValue = false;
  // 展开动画
  AnimationController _expandController;
  Animation<double> _expandAnimation;
  // 收起动画
  AnimationController _collapseController;
  Animation<double> _collapseAnimation;
  // 背景图
  String _bgImgBase64 =
      "";
  Uint8List _bgImgBytes;

  // 初始化
  @override
  void initState() {
    super.initState();
    // 图片转换
    _bgImgBytes = base64Decode(_bgImgBase64);
    // 展开动画
    _expandController = new AnimationController(
        duration: const Duration(milliseconds: 300), vsync: this);
    _expandAnimation =
        new Tween(begin: 0.0, end: 1.0).animate(_expandController)
          ..addListener(() {
            if (_expandAnimation.status == AnimationStatus.forward ||
                _expandAnimation.status == AnimationStatus.completed) {
              setState(() {
                var height =
                    MediaQuery.of(context).size.height * _expandAnimation.value;
                height = _headerHeight > height ? _headerHeight + 20.0 : height;
                _headerHeight = height < MediaQuery.of(context).size.height
                    ? height
                    : MediaQuery.of(context).size.height;
              });
            }
          });
    _expandAnimation.addStatusListener((status) {
      if (status == AnimationStatus.completed) {
        _expandController.reverse();
        setState(() {
          _showPullIcon = true;
        });
      }
    });
    // 收起动画
    _collapseController = new AnimationController(
        duration: const Duration(milliseconds: 300), vsync: this);
    _collapseAnimation =
        new Tween(begin: 1.0, end: 0.0).animate(_collapseController)
          ..addListener(() {
            if (_collapseAnimation.status == AnimationStatus.forward ||
                _collapseAnimation.status == AnimationStatus.completed) {
              setState(() {
                var height = MediaQuery.of(context).size.height *
                    _collapseAnimation.value;
                height = _headerHeight < height ? _headerHeight - 20.0 : height;
                _headerHeight = height < MediaQuery.of(context).size.height
                    ? height
                    : MediaQuery.of(context).size.height;
              });
            }
          });
    _collapseAnimation.addStatusListener((status) {
      if (status == AnimationStatus.completed) {
        _collapseController.reverse();
        setState(() {
          _showPullIcon = false;
          _readyToSecondFloor = false;
          _expandSecondFloor = false;
        });
      }
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
        body: Column(
      children: <Widget>[
        // 二楼Header
        Container(
          height: _headerHeight,
          width: double.infinity,
          child: Stack(
            children: <Widget>[
              Positioned(
                bottom: 0.0,
                left: 0.0,
                right: 0.0,
                child: GestureDetector(
                  onVerticalDragUpdate: (details) {
                    // 跟随滑动
                    setState(() {
                      var height = _headerHeight + details.delta.dy;
                      _headerHeight =
                          height < MediaQuery.of(context).size.height
                              ? height
                              : MediaQuery.of(context).size.height;
                    });
                  },
                  onVerticalDragEnd: (details) {
                    // 判断是否收起
                    if (_headerHeight <
                        MediaQuery.of(context).size.height -
                            _secondFloorHeight) {
                      _collapseController.forward();
                    } else {
                      _expandController.forward();
                    }
                  },
                  child: Container(
                    width: double.infinity,
                    height: MediaQuery.of(context).size.height,
                    child: Image.memory(
                      _bgImgBytes,
                      fit: BoxFit.cover,
                    ),
                  ),
                ),
              ),
              Positioned(
                bottom: 40.0,
                left: 0.0,
                right: 0.0,
                child: _showPullIcon
                    ? Container(
                        width: double.infinity,
                        height: _refreshHeight,
                        child: Center(
                            child: Icon(
                          Icons.keyboard_arrow_up,
                          color: Colors.white,
                        )),
                      )
                    : Container(),
              ),
              _readyToSecondFloor || _expandSecondFloor
                  ? Positioned(
                      bottom: 0.0,
                      left: 0.0,
                      right: 0.0,
                      child: Container(
                        width: double.infinity,
                        height: _refreshHeight,
                        child: Center(
                            child: Text(
                          Translations.of(context).text("welcomeToSecondFloor"),
                          style: TextStyle(
                            color: Colors.white,
                            fontSize: 18.0,
                          ),
                        )),
                      ),
                    )
                  : Positioned(
                      bottom: 0.0,
                      left: 0.0,
                      right: 0.0,
                      child: Container(
                        width: double.infinity,
                        height: _refreshHeight,
                        child: Center(
                            child: Container(
                          margin: EdgeInsets.only(right: 10.0),
                          width: 24.0,
                          height: 24.0,
                          child: CircularProgressIndicator(
                            value: _indicatorValue,
                            valueColor: AlwaysStoppedAnimation(Colors.white),
                            strokeWidth: 2.4,
                          ),
                        )),
                      ),
                    )
            ],
          ),
        ),
        Expanded(
          flex: 1,
          child: NotificationListener(
              child: EasyRefresh(
                  key: _easyRefreshKey,
                  refreshHeader: ListenerHeader(
                    key: _headerKey,
                    refreshHeight: _refreshHeight,
                    listener: this,
                  ),
                  refreshFooter: ClassicsFooter(
                    key: _footerKey,
                    loadHeight: 50.0,
                    loadText: Translations.of(context).text("pushToLoad"),
                    loadReadyText:
                        Translations.of(context).text("releaseToLoad"),
                    loadingText: Translations.of(context).text("loading"),
                    loadedText: Translations.of(context).text("loaded"),
                    noMoreText: Translations.of(context).text("noMore"),
                    moreInfo: Translations.of(context).text("updateAt"),
                    bgColor: Colors.orange,
                    textColor: Colors.black,
                  ),
                  onRefresh: () async {
                    if (_readyToSecondFloor) return;
                    await new Future.delayed(const Duration(seconds: 3), () {
                      setState(() {
                        str.clear();
                        str.addAll(addStr);
                      });
                    });
                  },
                  loadMore: () async {
                    await new Future.delayed(const Duration(seconds: 1), () {
                      if (str.length < 20) {
                        setState(() {
                          str.addAll(addStr);
                        });
                      }
                    });
                  },
                  child: new CustomScrollView(
                    // 手动维护semanticChildCount,用于判断是否没有更多数据
                    semanticChildCount: str.length,
                    slivers: <Widget>[
                      SliverAppBar(
                        floating: false,
                        pinned: true,
                        expandedHeight: 180.0,
                        flexibleSpace: FlexibleSpaceBar(
                          title: Text(
                              Translations.of(context).text("secondFloor")),
                        ),
                      ),
                      SliverPadding(
                        padding: EdgeInsets.all(0.0),
                        sliver: SliverFixedExtentList(
                            itemExtent: 70.0,
                            delegate: SliverChildBuilderDelegate(
                              (context, index) {
                                return new Container(
                                    height: 70.0,
                                    child: Card(
                                      child: new Center(
                                        child: new Text(
                                          str[index],
                                          style: new TextStyle(fontSize: 18.0),
                                        ),
                                      ),
                                    ));
                              },
                              childCount: str.length,
                            )),
                      )
                    ],
                  )),
              onNotification: (ScrollNotification notification) {
                // 判断手指放开
                if (notification is UserScrollNotification &&
                    notification.direction == ScrollDirection.idle) {
                  // 判断是否进入二楼
                  if (_readyToSecondFloor) {
                    setState(() {
                      _expandSecondFloor = true;
                    });
                    _expandController.forward();
                  }
                }
              }),
        )
      ],
    ));
  }

  @override
  void onRefreshEnd() {
    setState(() {
      _indicatorValue = 0.0;
    });
  }

  @override
  void onRefreshReady() {}

  @override
  void onRefreshRestore() {}

  @override
  void onRefreshStart() {
    _updateIndicatorValue = true;
  }

  @override
  void onRefreshed() {
    setState(() {
      _indicatorValue = 1.0;
    });
  }

  @override
  void onRefreshing() {
    _updateIndicatorValue = false;
    setState(() {
      _indicatorValue = null;
    });
  }

  @override
  void updateHeaderHeight(double newHeight) {
    if (!_expandSecondFloor) {
      setState(() {
        _headerHeight = newHeight;
      });
    }
    if (_updateIndicatorValue) {
      double indicatorValue = newHeight / _refreshHeight * 0.9;
      setState(() {
        _indicatorValue = indicatorValue < 0.9 ? indicatorValue : 0.9;
      });
    }
    // 判断是否进入二楼
    if (_headerKey.currentState.refreshHeaderStatus ==
        RefreshHeaderStatus.REFRESH_READY) {
      setState(() {
        if (newHeight >= _secondFloorHeight) {
          _readyToSecondFloor = true;
        } else {
          if (!_expandSecondFloor) {
            _readyToSecondFloor = false;
          }
        }
      });
    }
  }
}
